saveBook = async (event) => {
    event.preventDefault();
    let bookList = {
        bookTitle: this.state.bookTitle,
        bookAuthor: this.state.bookAuthor,
        publishedYear: this.state.publishedYear,
        genre: this.state.genre,
    };

    console.log('bookList => ' + JSON.stringify(bookList));
    // Validation checks
    if (!this.state.bookTitle || !this.state.bookAuthor || !this.state.publishedYear || !this.state.genre) {
        // Display an error message or prevent the form submission
        console.error('Please fill in all fields.');
        return;
    }
   
    try {
            // Rest of the code for saving the book
            // const response = await BookListServiceFetch.addBookListComponent(bookList);

            // // Display a success message or navigate to a success page
            // console.log('Book added successfully!');
            // this.props.history.push('/addBookList');
            BookListServiceFetch.addBookListComponent(bookList).then(() => {
            // Code to execute after the service call is successful (if needed)
            console.log('BookListComponent added successfully');
        })
        // } catch (error) {
        //     console.error('Error adding book:', error);
        // }
        }catch(error){
                // Code to handle errors
                console.error('Error adding BookListComponent:', error);
            };

        };

        //create event handler 
